function makeAka(
  name,
  segment = 5,
  width = 6,
  damage = 1,
  angle = 0,
  options = {}
) {
  if (options.offset == null) {
    options.offset = 1;
  }
  if (options.offset2 == null) {
    options.offset2 = 0;
  }
  let turrets = [];
  if (exports[`${name}Collision`] == null && !options.turrets) {
    exports[`${name}Collision`] = {
      PARENT: [exports.genericTank],
      TYPE: "tank",
      LABEL: "Collision",
      DANGER: 0,
      BODY: {
        PUSHABILITY: 2.5,
        HEALTH: 1e10,
        REGEN: 1e10,
        DAMAGE: wepDamageFactor * wepHealthFactor * 0.025 * damage,
        RESIST: base.RESIST,
        DENSITY: base.DENSITY,
      },
      HITS_OWN_TYPE: "everything",
      GIVE_KILL_MESSAGE: false,
      ACCEPTS_SCORE: false,
      LEVEL: 0,
      SCORE: 0,
      SHAPE: [
        [0.25, 0.25],
        [-0.25, 0.25],
        [-0.25, -0.25],
        [0.25, -0.25],
      ],
      DAMAGE_TURRET: true,
    };
  }
  width *= 0.75;
  segment /= 0.75;
  for (let i = 0; i < Math.floor(segment - 2); i++) {
    turrets.push({
      POSITION: [
        width / 2,
        10 + width * 0.55 * i,
        width * (0.825 - options.offset2),
        angle,
        0,
        -1,
      ],
      TYPE: exports[`${name}Collision`],
    });
    turrets.push({
      POSITION: [
        width / 2,
        10 + width * 0.55 * i,
        -width * (0.825 - options.offset2),
        -angle,
        0,
        -1,
      ],
      TYPE: exports[`${name}Collision`],
    });
  }
  for (let i = 0; i < segment; i++) {
    turrets.push({
      POSITION: [
        width / 2,
        10 + width * 0.55 * i,
        width * (0.325 - options.offset2),
        angle,
        0,
        -1,
      ],
      TYPE: exports[`${name}Collision`],
    });
    turrets.push({
      POSITION: [
        width / 2,
        10 + width * 0.55 * i,
        -width * (0.325 - options.offset2),
        -angle,
        0,
        -1,
      ],
      TYPE: exports[`${name}Collision`],
    });
  }
  let guns = [];
  if (options.guns) {
    for (let o of options.guns) {
      guns.push(o);
    }
  }
  guns.push(
    {
      POSITION: [
        (width / 2) * segment,
        width,
        1,
        0,
        ((width * 2) / 3) * options.offset,
        angle,
        0,
      ],
      PROPERTIES: {
        SKIN: 9,
      },
    },
    {
      POSITION: [
        (width / 2) * segment,
        width,
        1,
        0,
        ((-width * 2) / 3) * options.offset,
        -angle,
        0,
      ],
      PROPERTIES: {
        SKIN: 10,
      },
    }
  );
  return {
    PARENT: [exports.genericTank],
    LABEL: name,
    GUNS: guns,
    TURRETS: options.turrets == null ? turrets : [],
    IS_AKAFUJI: true,
  };
}

function createAnimationTankFrame(i, maxFrames, tank1, tank2, options) {
  return {
    PARENT: [exports.genericTank],
    LABEL: "...",
    DANGER: 3,
    GUNS: (function () {
      const output = [];
      for (let j = 0; j < (tank1.GUNS || []).length; j++) {
        const gun = JSON.parse(JSON.stringify(tank1.GUNS[j]));
        if (gun.PROPERTIES) {
          gun.PROPERTIES.SHOOT_SETTINGS = null;
          gun.PROPERTIES.TYPE = null;
        }
        for (let h = 0; h < gun.POSITION.length - 1 - !options.doAngles; h++) {
          gun.POSITION[h] *= (maxFrames - i) / maxFrames;
        }
        if (options.indicator) {
          output.push(gun, {
            POSITION: [
              gun.POSITION[0] * 0.8,
              gun.POSITION[1] * 0.8,
              gun.POSITION[2],
              gun.POSITION[3],
              gun.POSITION[4],
              gun.POSITION[5],
              0,
            ],
            PROPERTIES: {
              SKIN: (gun.PROPERTIES || {}).SKIN || 0,
              COLOR: 150,
            },
          });
        } else {
          output.push(gun);
        }
      }
      for (let j = 0; j < (tank2.GUNS || []).length; j++) {
        const gun = JSON.parse(JSON.stringify(tank2.GUNS[j]));
        if (gun.PROPERTIES) {
          gun.PROPERTIES.SHOOT_SETTINGS = null;
          gun.PROPERTIES.TYPE = null;
        }
        for (let h = 0; h < gun.POSITION.length - 1 - !options.doAngles; h++) {
          gun.POSITION[h] *= i / maxFrames;
        }
        if (options.indicator) {
          output.push(gun, {
            POSITION: [
              gun.POSITION[0] * 0.8,
              gun.POSITION[1] * 0.8,
              gun.POSITION[2],
              gun.POSITION[3],
              gun.POSITION[4],
              gun.POSITION[5],
              0,
            ],
            PROPERTIES: {
              SKIN: (gun.PROPERTIES || {}).SKIN || 0,
              COLOR: 180,
            },
          });
        } else {
          output.push(gun);
        }
      }
      return output;
    })(),
    TURRETS: options.turrets || [],
  };
}

