for (const key in exports) {
  if (exports.hasOwnProperty(key)) {
    for (const element in exports[key]) {
      if (element === "GUNS") {
        if (!(exports[key].GUNS instanceof Array)) {
          throw new ReferenceError(
            "GUN ERROR || WILL NOT PROCEDE!!! (Invalid gun key) Tank: " + key
          );
        }
        for (let gun of exports[key].GUNS) {
          if (
            typeof gun != "object" ||
            !(gun.POSITION instanceof Array) ||
            gun.POSITION.length !== 7
          ) {
            throw new ReferenceError(
              "GUN ERROR || WILL NOT PROCEDE!!! (Position specific) Tank: " +
                key
            );
          }
          for (let i = 0; i < 6; i++) {
            // Don't count delay
            if (!Number.isFinite(gun.POSITION[i])) {
              throw new ReferenceError(
                "GUN ERROR || WILL NOT PROCEDE!!! (Position specific) Tank: " +
                  key
              );
            }
          }
          if ("PROPERTIES" in gun) {
            if (
              "TYPE" in gun.PROPERTIES &&
              typeof gun.PROPERTIES.TYPE !== "object"
            ) {
              throw new ReferenceError(
                "GUN ERROR || WILL NOT PROCEDE!!! (Ammo specific) Tank: " + key
              );
            }
            if (
              "COLOR" in gun.PROPERTIES &&
              typeof gun.PROPERTIES.COLOR !== "number"
            ) {
              throw new ReferenceError(
                "GUN ERROR || WILL NOT PROCEDE!!! (Color specific) Tank: " + key
              );
            }
            if (
              "COLOR_OVERRIDE" in gun.PROPERTIES &&
              typeof gun.PROPERTIES.COLOR_OVERRIDE !== "number"
            ) {
              throw new ReferenceError(
                "GUN ERROR || WILL NOT PROCEDE!!! (Color_override specific) Tank: " +
                  key
              );
            }
            if (
              "SKIN" in gun.PROPERTIES &&
              typeof gun.PROPERTIES.SKIN !== "number"
            ) {
              throw new ReferenceError(
                "GUN ERROR || WILL NOT PROCEDE!!! (skin specific) Tank: " + key
              );
            }
            if (
              "SHOOT_SETTINGS" in gun.PROPERTIES &&
              gun.PROPERTIES.SHOOT_SETTINGS != null &&
              (typeof gun.PROPERTIES.SHOOT_SETTINGS !== "object" ||
                Object.values(gun.PROPERTIES.SHOOT_SETTINGS).findIndex(
                  (entry) => !Number.isFinite(entry)
                ) > -1)
            ) {
              console.log(gun.PROPERTIES.SHOOT_SETTINGS);
              throw new ReferenceError(
                "GUN ERROR || WILL NOT PROCEDE!!! (Stat specific) Tank: " + key
              );
            }
          }
        }
      }
      if (element === "TURRETS") {
        if (!(exports[key].TURRETS instanceof Array)) {
          throw new ReferenceError(
            "TURRET ERROR || WILL NOT PROCEDE!!! Tank: " + key
          );
        }
        for (let turret of exports[key].TURRETS) {
          if (
            typeof turret != "object" ||
            !(turret.POSITION instanceof Array) ||
            turret.POSITION.length !== 6
          ) {
            throw new ReferenceError(
              "TURRET ERROR || WILL NOT PROCEDE!!! Tank: " + key
            );
          }
          for (let i = 0; i < 6; i++) {
            if (!Number.isFinite(turret.POSITION[i])) {
              throw new ReferenceError(
                "TURRET ERROR || WILL NOT PROCEDE!!! (Position specific) Tank: " +
                  key
              );
            }
          }
          if ("TYPE" in turret && typeof turret.TYPE !== "object") {
            throw new ReferenceError(
              "TURRET ERROR || WILL NOT PROCEDE!!! (Type specific) Tank: " + key
            );
          }
        }
      }
      if (element.startsWith("UPGRADES_TIER_")) {
        exports[key][element].forEach((upgrade) => {
          if (upgrade == null || typeof upgrade != "object") {
            throw new ReferenceError(
              "UPGRADE ERROR || WILL NOT PROCEDE!!! Tank: " +
                key +
                " Upgrade key: " +
                element
            );
          }
        });
      }
    }
  }
}